import styles from "./Roster.module.scss";

export default function Roster() {
  return (
    <section className={` ${styles.roster} section`}>
      <div className={(styles.panel, styles.one)}>one</div>
      <div className={(styles.panel, styles.two)}>two</div>
      <div className={(styles.panel, styles.three)}>three</div>
      <div className={(styles.panel, styles.four)}>four</div>
    </section>
  );
}
